(11, 0, 'Hello World!', 'Your computer won''t respond when you yell at it. Why not learn to \ntalk to your computer in its own language? Whether you want to write \ngames, start a business, or you''re just curious, learning to program is a\n great place to start. Plus, programming is fun!\n\nHello World! provides a gentle but thorough introduction to \nthe world of computer programming. It''s written in language a \n12-year-old can follow, but anyone who wants to learn how to program a \ncomputer can use it. Even adults. Written by Warren Sande and his son, \nCarter, and reviewed by professional educators, this book is kid-tested \nand parent-approved. \n\nYou don''t need to know anything about programming to use the book. \nBut you should know the basics of using a computer--e-mail, surfing the \nweb, listening to music, and so forth. If you can start a program and \nsave a file, you should have no trouble using this book.&nbsp;', 0, 0, '6E6B3F2E-DC84-4CF8-922B-73D46B496E6B', '2013-04-03 14:41:47', 'STAFF', '1) Chorn Sovichey', 'SEND', '', 'STAFF_TO_STAFF', '', '2013-04-03 14:41:18', '14F6-552D', '2013-04-03 14:41:47', '14F6-552D', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00', '', 0),
(14, 0, 'Hello World!', 'Your computer won''t respond when you yell at it. Why not learn to&nbsp;talk to your computer in its own language? Whether you want to write&nbsp;games, start a business, or you''re just curious, learning to program is agreat place to start. Plus, programming is fun!Hello World! provides a gentle but thorough introduction to&nbsp;the world of computer programming. It''s written in language a&nbsp;12-year-old can follow, but anyone who wants to learn how to program a&nbsp;computer can use it. Even adults. Written by Warren Sande and his son,&nbsp;Carter, and reviewed by professional educators, this book is kid-tested&nbsp;and parent-approved.&nbsp;You don''t need to know anything about programming to use the book.&nbsp;But you should know the basics of using a computer--e-mail, surfing the&nbsp;web, listening to music, and so forth. If you can start a program and&nbsp;save a file, you should have no trouble using this book.&nbsp;', 0, 0, '6E6B3F2E-DC84-4CF8-922B-73D46B496E6B', '2013-04-03 16:17:40', 'STAFF', '1) Hem Sophanna', 'SEND', '', 'STAFF_TO_STAFF', '', '2013-04-03 16:16:15', '14F6-552D', '2013-04-03 16:17:40', '14F6-552D', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00', '', 0),
