(97, 'x11H32A1ei3I7W54Yyx2YcEhxUs3mNia6A6', 0, 0, 'x5WYeij9728u8BW55sEhinpPYwmnmK4ww5K', 44, '', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Introduction<br />\r\nEconomics is the study of how people behave. Every day, people and society are confronted by choices. Should you go to university or start a career? What should you do with your next dollar? Should the government raise the minimum wage, or not? Choices involve trade-offs where we are choosing between two things that we like. The outcomes of choices have both costs and benefits to consider. Economics is the study of how people and societies make such decisions in the production, exchange, distribution and consumption of goods and services.<br />\r\n<br />\r\nAt UC emphasis is placed on three core areas of study.<br />\r\n<br />\r\nMicroeconomics examines the behaviour of individuals, households and firms, and their interactions in markets. It includes an examination of economic choices in decentralised markets and reaches conclusions about economic welfare. Markets that are regulated by government, have only a few participants or are characterised by different amounts of information, are also examined.<br />\r\n<br />\r\nMacroeconomics examines the performance of an economy as a whole, and provides insights into the reasons for fluctuations and trends in national income, unemployment, inflation, interest rates and exchange rates. It also involves the examination of governments&#39; taxation, expenditure, monetary and exchange rate policies.<br />\r\n<br />\r\nEconometrics brings economic theories to data. It is the study of methods aimed at testing economic theories and providing quantitative information on economic relationships for policy analyses and decisions. Courses provide an account of econometric methods and illustrations of these methods, with applications to real data sets in laboratory classes that introduce the latest developments in computing and web technology.<br />\r\n<br />\r\nRecommended background<br />\r\nWhile previous study of economics is useful preparation, it is not essential to have studied economics at secondary school level.<br />\r\n<br />\r\nStudents intending to major in Economics are strongly advised to include mathematics with calculus and statistics and modelling in their NCEA Level 3 programme.<br />\r\n<br />\r\nA broad education, including history and English, is useful to develop the ability to write clearly and analyse written material.</p>\r\n\r\n<p>Am Stollhenn 18</p>\r\n\r\n<p>55120 Mainz</p>\r\n</body>\r\n</html>\r\n', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p>\r\n			Introduction<br />\r\n			Economics is the study of how people behave. Every day, people and society are confronted by choices. Should you go to university or start a career? What should you do with your next dollar? Should the government raise the minimum wage, or not? Choices involve trade-offs where we are choosing between two things that we like. The outcomes of choices have both costs and benefits to consider. Economics is the study of how people and societies make such decisions in the production, exchange, distribution and consumption of goods and services.<br />\r\n			<br />\r\n			At UC emphasis is placed on three core areas of study.<br />\r\n			<br />\r\n			Microeconomics examines the behaviour of individuals, households and firms, and their interactions in markets. It includes an examination of economic choices in decentralised markets and reaches conclusions about economic welfare. Markets that are regulated by government, have only a few participants or are characterised by different amounts of information, are also examined.<br />\r\n			<br />\r\n			Macroeconomics examines the performance of an economy as a whole, and provides insights into the reasons for fluctuations and trends in national income, unemployment, inflation, interest rates and exchange rates. It also involves the examination of governments&#39; taxation, expenditure, monetary and exchange rate policies.<br />\r\n			<br />\r\n			Econometrics brings economic theories to data. It is the study of methods aimed at testing economic theories and providing quantitative information on economic relationships for policy analyses and decisions. Courses provide an account of econometric methods and illustrations of these methods, with applications to real data sets in laboratory classes that introduce the latest developments in computing and web technology.<br />\r\n			<br />\r\n			Recommended background<br />\r\n			While previous study of economics is useful preparation, it is not essential to have studied economics at secondary school level.<br />\r\n			<br />\r\n			Students intending to major in Economics are strongly advised to include mathematics with calculus and statistics and modelling in their NCEA Level 3 programme.<br />\r\n			<br />\r\n			A broad education, including history and English, is useful to develop the ability to write clearly and analyse written material.</p>\r\n	</body>\r\n</html>\r\n', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p>\r\n			Introduction<br />\r\n			Economics is the study of how people behave. Every day, people and society are confronted by choices. Should you go to university or start a career? What should you do with your next dollar? Should the government raise the minimum wage, or not? Choices involve trade-offs where we are choosing between two things that we like. The outcomes of choices have both costs and benefits to consider. Economics is the study of how people and societies make such decisions in the production, exchange, distribution and consumption of goods and services.<br />\r\n			<br />\r\n			At UC emphasis is placed on three core areas of study.<br />\r\n			<br />\r\n			Microeconomics examines the behaviour of individuals, households and firms, and their interactions in markets. It includes an examination of economic choices in decentralised markets and reaches conclusions about economic welfare. Markets that are regulated by government, have only a few participants or are characterised by different amounts of information, are also examined.<br />\r\n			<br />\r\n			Macroeconomics examines the performance of an economy as a whole, and provides insights into the reasons for fluctuations and trends in national income, unemployment, inflation, interest rates and exchange rates. It also involves the examination of governments&#39; taxation, expenditure, monetary and exchange rate policies.<br />\r\n			<br />\r\n			Econometrics brings economic theories to data. It is the study of methods aimed at testing economic theories and providing quantitative information on economic relationships for policy analyses and decisions. Courses provide an account of econometric methods and illustrations of these methods, with applications to real data sets in laboratory classes that introduce the latest developments in computing and web technology.<br />\r\n			<br />\r\n			Recommended background<br />\r\n			While previous study of economics is useful preparation, it is not essential to have studied economics at secondary school level.<br />\r\n			<br />\r\n			Students intending to major in Economics are strongly advised to include mathematics with calculus and statistics and modelling in their NCEA Level 3 programme.<br />\r\n			<br />\r\n			A broad education, including history and English, is useful to develop the ability to write clearly and analyse written material.</p>\r\n	</body>\r\n</html>\r\n', '', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Introduction<br />\r\nEconomics is the study of how people behave. Every day, people and society are confronted by choices. Should you go to university or start a career? What should you do with your next dollar? Should the government raise the minimum wage, or not? Choices involve trade-offs where we are choosing between two things that we like. The outcomes of choices have both costs and benefits to consider. Economics is the study of how people and societies make such decisions in the production, exchange, distribution and consumption of goods and services.<br />\r\n<br />\r\nAt UC emphasis is placed on three core areas of study.<br />\r\n<br />\r\nMicroeconomics examines the behaviour of individuals, households and firms, and their interactions in markets. It includes an examination of economic choices in decentralised markets and reaches conclusions about economic welfare. Markets that are regulated by government, have only a few participants or are characterised by different amounts of information, are also examined.<br />\r\n<br />\r\nMacroeconomics examines the performance of an economy as a whole, and provides insights into the reasons for fluctuations and trends in national income, unemployment, inflation, interest rates and exchange rates. It also involves the examination of governments&#39; taxation, expenditure, monetary and exchange rate policies.<br />\r\n<br />\r\nEconometrics brings economic theories to data. It is the study of methods aimed at testing economic theories and providing quantitative information on economic relationships for policy analyses and decisions. Courses provide an account of econometric methods and illustrations of these methods, with applications to real data sets in laboratory classes that introduce the latest developments in computing and web technology.<br />\r\n<br />\r\nRecommended background<br />\r\nWhile previous study of economics is useful preparation, it is not essential to have studied economics at secondary school level.<br />\r\n<br />\r\nStudents intending to major in Economics are strongly advised to include mathematics with calculus and statistics and modelling in their NCEA Level 3 programme.<br />\r\n<br />\r\nA broad education, including history and English, is useful to develop the ability to write clearly and analyse written material.</p>\r\n\r\n