INSERT INTO `t_letter` (`ID`, `NAME`, `CONTENT`, `TYPE`) VALUES
(1, 'Certify', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p style="text-align: center;">\r\n			<span style="font-size:20px;"><strong>Sample Certification Letter</strong></span></p>\r\n		<p>\r\n			Printed on Corporation&rsquo;s Letter Head&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n		<p>\r\n			Date</p>\r\n		<p>\r\n			TXMAS Program</p>\r\n		<p>\r\n			Texas Comptroller of Public Accounts</p>\r\n		<p>\r\n			1711 San Jacinto Blvd.</p>\r\n		<p>\r\n			Austin, TX 78701</p>\r\n		<p>\r\n			Subject: Certification of Prices, Terms and Conditions</p>\r\n		<p>\r\n			To Whom It May Concern:</p>\r\n		<p>\r\n			(Your Corporation&rsquo;s Name) hereby certifies that all prices on the attached offering are current GSA Schedule prices and that such prices are guaranteed to remain current with any approved GSA pricing changes for the entire term of (Your Corporation&rsquo;s Name) Texas Multiple Award Schedule contract.&nbsp; In the event of a decrease in prices offered to the GSA, (Your Corporation&rsquo;s Name) agrees to notify the State of Texas within thirty (30) working days of such decrease and offer such pricing to the State of Texas.&nbsp; If (Your Corporation&rsquo;s Name) fails to notify the State of such decrease in pricing as specified herein, the State shall have the right to cancel the Texas Multiple Award Schedule contract and (Your Corporation&rsquo;s Name) shall issue a refund for items procured under the Texas Multiple Award Schedule contract.&nbsp; Such refund shall be equal to the difference between the prices offered under the attached offering and the lower price.</p>\r\n		<p>\r\n			If any statement contained in this certification is untrue, the State shall have the right to cancel the Texas Multiple Award Schedule contract in its entirety.</p>\r\n		<p>\r\n			Sincerely,</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			(Your Corporation&rsquo;s Representative, authorized to legally bind the company)</p>\r\n		<p>\r\n			Note:&nbsp; This letter and a copy of your current GSA Authorized Federal Supply Schedule Price List must accompany the State of Texas Terms and Conditions and any Addendums thereto.&nbsp; All Addendums are subject to review, prior to approval by the Texas Comptroller of Public Accounts.</p>\r\n	</body>\r\n</html>\r\n', 1),
(2, 'Company Regulation', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p>\r\n			I have attached appointment letter. After giving the Offer Letter, an Appointment Letter is the next step of interaction between a company and an employee.</p>\r\n		<p>\r\n			[date]</p>\r\n		<p>\r\n			[Name]</p>\r\n		<p>\r\n			[Address]</p>\r\n		<p>\r\n			Dear Mr. &hellip;&hellip;&hellip;.,</p>\r\n		<p>\r\n			<strong>Re : Appointment</strong></p>\r\n		<p>\r\n			With&nbsp; reference&nbsp; to&nbsp; your application &nbsp;dated [date] and&nbsp; the subsequent&nbsp; interview&nbsp; you&nbsp; had&nbsp; with us,&nbsp; we&nbsp; have&nbsp; pleasure&nbsp; in appointing you as a <strong>` &nbsp;[Designation &ndash; Department].&rsquo; </strong>&nbsp;at our &hellip;&hellip;.. w.e.f.. [date].</p>\r\n		<p>\r\n			The terms and conditions of your appointment will be as follows:</p>\r\n		<p>\r\n			1)&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;a. &nbsp;&nbsp;Your basic salary will be Rs&hellip;&hellip;&hellip;. /- (Amount in words) per month.</p>\r\n		<p>\r\n			b.&nbsp;&nbsp;&nbsp;&nbsp; <strong>House Rent Allowance</strong></p>\r\n		<p>\r\n			House Rent allowance is payable to you at the rate of 40% of your basic salary per month.</p>\r\n		<p>\r\n			c&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;<strong>Transport</strong></p>\r\n		<p>\r\n			You&nbsp; will&nbsp; be&nbsp; paid Rs&hellip;&hellip;&hellip;./- (Rs Amount in words)&nbsp; per&nbsp; month&nbsp; towards Transport.</p>\r\n		<p>\r\n			d.&nbsp;&nbsp;&nbsp;&nbsp; <strong>Education Allowance</strong></p>\r\n		<p>\r\n			You&nbsp; will&nbsp; be&nbsp; paid Rs&hellip;&hellip;./- (Amount in words)&nbsp; per&nbsp; month towards Education Allowance.</p>\r\n		<p>\r\n			e&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Other Allowance</strong></p>\r\n		<p>\r\n			You will be paid Rs. &hellip;&hellip; /- (Rs Amount in words) per month towards Other Allowance.</p>\r\n		<p>\r\n			f.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Leave Travel Assistance</strong></p>\r\n		<p>\r\n			Leave Travel Assistance will be paid to you at the rate of Rs&hellip;&hellip;&hellip; /- (Amount in words) per&nbsp; annum&nbsp; after completion of&nbsp; twelve month&rsquo;s service in the Company.</p>\r\n		<p>\r\n			&hellip;&hellip;&hellip;&hellip;&hellip; 2/-</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p align="center">\r\n			:&nbsp; 2&nbsp; :</p>\r\n		<p align="right">\r\n			<strong>&nbsp;</strong></p>\r\n		<p align="right">\r\n			<strong>[name of the employee]</strong></p>\r\n		<p>\r\n			g.&nbsp; <strong>Medical Assistance</strong></p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			According to the Company&rsquo;s rules, you will be entitled to the&nbsp; membership&nbsp; of&nbsp; the medical&nbsp; scheme&nbsp; in&nbsp; force.&nbsp;&nbsp; In addition you will be entitled to reimbursement of&nbsp; other actual&nbsp;&nbsp;&nbsp;&nbsp; medical&nbsp;&nbsp;&nbsp;&nbsp; expenses&nbsp;&nbsp;&nbsp;&nbsp; up to&nbsp;&nbsp;&nbsp;&nbsp; Rs&hellip;&hellip;&hellip; /- (Amount in words) per annum.</p>\r\n		<p>\r\n			h.&nbsp; <strong>Provident Fund</strong></p>\r\n		<p>\r\n			You&nbsp; will&nbsp; be entitled to become a member of&nbsp; our&nbsp; Scheme&nbsp; which&nbsp; is&nbsp; governed by &nbsp;Employees&rsquo; Provident&nbsp; Fund&nbsp; Act&nbsp; &amp; Scheme 1952.</p>\r\n		<p>\r\n			i.&nbsp;&nbsp; <strong>Gratuity</strong></p>\r\n		<p>\r\n			As per Gratuity Act.</p>\r\n		<p>\r\n			2)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Your appointment will initially be for a period of 6&nbsp; months&nbsp; probation from the date of your joining during which&nbsp; period your&nbsp; services&nbsp; may&nbsp; be terminable without&nbsp; any&nbsp; notice&nbsp; and&nbsp; without&nbsp; assigning any reason whatsoever.</p>\r\n		<p>\r\n			3)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; On satisfactory completion of the probationary period your appointment&nbsp;&nbsp; will&nbsp;&nbsp; be&nbsp;&nbsp; confirmed&nbsp;&nbsp; in&nbsp;&nbsp; writing. After confirmation, your services may be terminated at any time by giving two months notice in writing by either side. In case&nbsp; you&nbsp; leave our employment without any notice, we shall&nbsp; have&nbsp; the&nbsp; right&nbsp; to&nbsp; deduct&nbsp; as&nbsp; liquidated&nbsp; damages&nbsp; an&nbsp;&nbsp; amount equivalent&nbsp; to two months notice from any money&nbsp; or&nbsp; moneys that may be due.</p>\r\n		<p>\r\n			4)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You will be entitled to leave as per the Company&rsquo;s rules and regulations.</p>\r\n		<p>\r\n			5)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You will be liable to be transferred to any branch, division or department of the Company or be sent on deputation.</p>\r\n		<p>\r\n			6)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You will promote and expand the business of the Company&nbsp; and not&nbsp; directly or indirectly and either solely or jointly&nbsp; be&nbsp; engaged&nbsp; in&nbsp; any&nbsp; service or other&nbsp; business&nbsp; or&nbsp; profession&nbsp; whether during or after the hours of employment.</p>\r\n		<p>\r\n			7)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You will hold as confidential:</p>\r\n		<p>\r\n			a.&nbsp; any knowledge concerning the affairs of the Company&nbsp; which you&nbsp; may acquire in the course of your employment with the Company;</p>\r\n		<p>\r\n			&hellip;&hellip;&hellip;&hellip;&hellip;&nbsp; 3/-</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p align="center">\r\n			:&nbsp; 3&nbsp; :</p>\r\n		<p align="right">\r\n			<strong>&nbsp;</strong></p>\r\n		<p align="right">\r\n			<strong>[name of the employee]</strong></p>\r\n		<p align="right">\r\n			<strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></p>\r\n		<p>\r\n			b.&nbsp; any&nbsp; knowledge&nbsp; relating&nbsp; to&nbsp; manufacturing&nbsp; formulae&nbsp; and processes&nbsp; or any other secrets or secret process and&nbsp; any&nbsp; knowledge&nbsp; relating&nbsp; to the structure or&nbsp; working of&nbsp; any&nbsp; machinery used by the Company;</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; any&nbsp; knowledge&nbsp; relating to the source of&nbsp; supply&nbsp; of&nbsp; any&nbsp; goods&nbsp; used in the manufacture of the Company&rsquo;s goods&nbsp; and any&nbsp; special or secret knowledge relating to the&nbsp; purchase of the aforesaid goods;</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			d.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; any knowledge relating to the Company&rsquo;s sales&nbsp; department, including&nbsp; special methods of selling, special methods&nbsp; of working&nbsp; territories,&nbsp; sales systems&nbsp; or&nbsp; any&nbsp; information contained&nbsp; in&nbsp; any&nbsp; of the&nbsp; Company&rsquo;s&nbsp; confidential&nbsp; sales&nbsp; department papers and documents.</p>\r\n		<p>\r\n			d.</p>\r\n		<p>\r\n			8)&nbsp;&nbsp;&nbsp;&nbsp; You&nbsp; will not at any time hereafter without the&nbsp; consent&nbsp; in writing&nbsp;&nbsp; of&nbsp;&nbsp; the&nbsp; Company&nbsp; divulge&nbsp; or&nbsp; make&nbsp;&nbsp; known&nbsp;&nbsp; any trusts, secrets,&nbsp; accounts or dealings of or relating to&nbsp; the Company&rsquo;s business.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			9)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You undertake that you will not disclose the information or knowledge relating or any part thereof disclosed to you or gained by you by reason of your employment.&nbsp; This obligation shall continue to remain in force even after your leaving the service of the Company.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			10)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a. You&nbsp; will be responsible for safe keeping and return&nbsp; in good&nbsp; condition and order all our property which may&nbsp; be in your use, custody and charge.</p>\r\n		<p>\r\n			10)</p>\r\n		<p>\r\n			10)b.&nbsp; You will return forthwith, as and when called upon to do so,&nbsp;&nbsp; in&nbsp;&nbsp; good&nbsp;&nbsp; condition&nbsp; and&nbsp;&nbsp; order,&nbsp;&nbsp; all&nbsp;&nbsp; notes, sketches, designs, drawings,&nbsp;&nbsp;&nbsp; charts, documents, etc. which may have come into your possession&nbsp; during the course&nbsp; of&nbsp; your employment.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			11)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You will devote your whole time and attention and&nbsp; abilities to&nbsp; the business of the Company and shall serve the&nbsp; Company honestly and faithfully carry out all lawful directions&nbsp; and orders&nbsp; of&nbsp; the&nbsp; company in discharge of&nbsp; your&nbsp; duties.&nbsp; The Company&nbsp; shall&nbsp; be entitled in its&nbsp; absolute&nbsp; discretion&nbsp; to change your designation.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			12)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You will not in any way pledge the credit of the Company or expose the Company&nbsp; to&nbsp; any&nbsp; pecuniary&nbsp;&nbsp; liabilities&nbsp;&nbsp; or obligations&nbsp; nor shall you advance moneys or give credit&nbsp; to&nbsp; any person without the prior written consent of the Company.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;. 4/-</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p align="center">\r\n			:&nbsp; 4&nbsp; :</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p align="right">\r\n			<strong>&nbsp;</strong></p>\r\n		<p align="right">\r\n			<strong>[name of the employee]</strong></p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			13)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If&nbsp; at&nbsp; any&nbsp; time, in our opinion, which is&nbsp; final&nbsp; in&nbsp; this matter&nbsp; you&nbsp; are&nbsp; insolvent or found&nbsp; guilty&nbsp; of&nbsp; dishonesty disobedience, disorderly behavior, negligence, indiscipline, absence&nbsp; from duty without permission or any&nbsp; other&nbsp; conduct considered&nbsp; by us detrimental to our interest&nbsp; or&nbsp; violation of&nbsp; one or more terms of this letter, your services&nbsp; may&nbsp; be terminated without notice.</p>\r\n		<p>\r\n			13)</p>\r\n		<p>\r\n			14)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You will abide by the staff rules and regulations applicable&nbsp; to&nbsp; you&nbsp; which&nbsp; are in force for the time being&nbsp; or&nbsp; may&nbsp; be framed from time to time.</p>\r\n		<p>\r\n			14)</p>\r\n		<p>\r\n			15)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Your&nbsp; appointment&nbsp; is on the clear&nbsp; understanding&nbsp; that&nbsp; the information furnished by you in your employment&nbsp; application form is correct and the certificates and references produced by you are genuine and bonafide.</p>\r\n		<p>\r\n			15)</p>\r\n		<p>\r\n			Kindly confirm your acceptance of the above terms and&nbsp; conditions by&nbsp; returning&nbsp; the duplicate copy of this letter duly&nbsp; signed&nbsp; by&nbsp; you.</p>\r\n		<p>\r\n			Yours faithfully,</p>\r\n		<p>\r\n			<strong>&nbsp;</strong></p>\r\n		<p>\r\n			<strong>&nbsp;</strong></p>\r\n		<p>\r\n			<strong>VICE PRESIDENT &ndash; HR</strong></p>\r\n		<p>\r\n			I agree to the above terms and conditions.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&ndash;</p>\r\n		<p>\r\n			SIGNATURE &amp; DATE</p>\r\n	</body>\r\n</html>\r\n', 0),
